import React, {Component} from 'react';

import './Poem.css';


export class Poem extends Component {
  render() {
    return (
      <div className="Poem col-6">
        <div className="PoemBlocker"/>
        {this.props.children}
        <div className="PoemFader"/>
      </div>
    );
  }
}


export class Stanza extends Component {
  render() {
    return (
      <div className="Stanza">
        {this.props.children}
      </div>
    );
  }
}
